        neigbours.push(matrix[i - 1][j]);
        neigbours.push(matrix[i][j - 1]);
      } else {
        neigbours.push(matrix[i - 1][j]);
        neigbours.push(matrix[i][j + 1]);
        neigbours.push(matrix[i][j - 1]);
      }
      /* First column */
